import ReactDOM from 'react-dom'
import logo from './logo.svg';
import './App.css';
import Sidebutton from './SideButton.js';


function App() {
  return (
    <div className="App">
      <h1>Ben Lottes</h1>
      <div>
          <Sidebutton button_text1="Projects" button_text2="Experience" button_text3="Resume"/>
      </div>
    </div>
  );
}

export default App;
